pragma solidity ^0.5.0;

import "./eMoneyToken/EmoneyTokenDollar.sol";
import "./eMoneyToken/EmoneyTokenPeso.sol";
import "./ICrossBoarderPayment.sol";
import "./libraries/StringUtil.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

contract CrossBoarderPayment is ICrossBoarderPayment{

    using StringUtil for string;
    using SafeMath for uint256;

    struct Transfer {
        address issuer;
        address origin;
        address target;
        address operator;
        uint256 value;
        uint256 fee;
        uint256 tasa;
        TransferStatusCode status;
    }

    EmoneyTokenDollar internal eDollars;
    EmoneyTokenPeso internal ePesos;

    constructor(EmoneyTokenDollar _eDollars, EmoneyTokenPeso _ePesos, address _feeAgent) public {
        require(address(_eDollars) != address(0), "EDollars Token address can not be zero address");
        require(address(_ePesos) != address(0), "EPesos Token address can not be zero address");
        eDollars = _eDollars;
        ePesos = _ePesos;
        transferAgent = msg.sender;
        feeAgent = _feeAgent;
    }

    mapping(bytes32 => Transfer) private orderedTransfers;
    address public transferAgent;
    address public feeAgent;

    function orderTransfer(string calldata operationId, address to, address operator, uint256 value) external returns (bool) {
        emit TransferOrdered(
            msg.sender,
            operationId,
            to,
            operator,
            value
        );

        _checkTransfer(to);

        return _orderTransfer(
            msg.sender,
            operationId,
            to,
            operator,
            value
        );
    }

    function setFeeTasa(string calldata operationId, uint256 fee, uint256 tasa) external returns (bool){
        require(msg.sender == feeAgent, "Set fee can only be executed by the fee agent");
        emit FeeTasaSeted(operationId, msg.sender, fee, tasa);
        return _setFeeTasa(operationId, fee, tasa);
    }

    function cancelTransfer(string calldata operationId) external returns (bool) {
        bytes32 operationIdHash = operationId.toHash();

        Transfer storage cancelableTransfer = orderedTransfers[operationIdHash];

        require(cancelableTransfer.status == TransferStatusCode.Ordered, "A transfer can only be cancelled in status Ordered");
        require(
            msg.sender == cancelableTransfer.issuer || msg.sender == cancelableTransfer.origin,
            "A transfer can only be cancelled by the orderer or the walletToBePaidOut"
        );

        eDollars.releaseHold(operationId);

        cancelableTransfer.status = TransferStatusCode.Cancelled;

        emit TransferCancelled(
            cancelableTransfer.issuer,
            operationId
        );

        return true;
    }

    function processTransfer(string calldata operationId) external returns (bool) {
        bytes32 operationIdHash = operationId.toHash();

        Transfer storage transferOrdered = orderedTransfers[operationIdHash];
        eDollars.hold(operationId,transferOrdered.origin,transferOrdered.target,msg.sender,transferOrdered.value,0);

    }

    function executeTransfer(string calldata operationId) external returns (bool){
        require(msg.sender == transferAgent, "A transfer can only be executed by the transfer agent");
        _burnHolding(operationId);
        _executeTransfer(operationId);

        return true;
    }

/*    function rejectTransfer(string calldata operationId, string calldata reason) external returns (bool) {
        bytes32 operationIdHash = operationId.toHash();

        Transfer storage rejectedPayout = orderedTransfers[operationIdHash];

        require(rejectedPayout.status == TransferStatusCode.Ordered, "A payout can only be rejected from status Ordered");
        require(msg.sender == payoutAgent, "A payout can only be rejected by the payout agent");

        Hold storage rejectedHold = holds[operationIdHash];

        _releaseHold(operationId);

        rejectedPayout.status = TransferStatusCode.Rejected;

        emit PayoutRejected(
            rejectedHold.issuer,
            operationId,
            reason
        );

        return true;
    } */

    function retrieveTransferData(string calldata operationId) external view returns (
        address origin,
        address to,
        address operator,
        uint256 value,
        uint256 fee,
        uint256 tasa,
        TransferStatusCode status
    )
    {
        bytes32 operationIdHash = operationId.toHash();

        Transfer storage retrievedTransfer = orderedTransfers[operationIdHash];
//        Hold storage retrievedHold = holds[operationIdHash];

        return (
            retrievedTransfer.origin,
            retrievedTransfer.target,
            retrievedTransfer.operator,
            retrievedTransfer.value,
            retrievedTransfer.fee,
            retrievedTransfer.tasa,
            retrievedTransfer.status
        );
    }

    function _orderTransfer(
        address orderer,
        string memory operationId,
        address walletToBeTransfered,
        address operator,
        uint256 value
    ) internal returns (bool)
    {
        Transfer storage newTransfer = orderedTransfers[operationId.toHash()];
        require(newTransfer.value == 0, "This operationId already exists");
        require(operator != address(0), "Operator address must not be zero address");
        require(value > 0, "Value must be greater than zero");

        require(eDollars.balanceOf(orderer)>value,"Account doesn't have founds to transfer");
        require(ePesos.isWhitelisted(walletToBeTransfered), "Destination Account isn't whitelisted");

        newTransfer.issuer = msg.sender;
        newTransfer.origin = orderer;
        newTransfer.target = walletToBeTransfered;
        newTransfer.operator = operator;
        newTransfer.value = value;
        newTransfer.status = TransferStatusCode.Ordered;

        eDollars.hold(operationId,newTransfer.origin,newTransfer.target,newTransfer.operator,newTransfer.value,0);

        return true;
    }

    function _burnHolding(string memory operationId) internal returns(bool){
        Transfer storage orderedTransfer = orderedTransfers[operationId.toHash()];
        require(orderedTransfer.value != 0, "This operationId doesn't exist");
        require(orderedTransfer.status == TransferStatusCode.FeeSet, "A transfer can only be executed from status FeeSet");
        eDollars.executeHold(operationId,orderedTransfer.value);
        orderedTransfer.status = TransferStatusCode.HoldBurned;
    }

    function _executeTransfer(string memory operationId) internal returns(bool){
        Transfer storage orderedTransfer = orderedTransfers[operationId.toHash()];
        require(orderedTransfer.value != 0, "This operationId doesn't exist");
        require(orderedTransfer.status == TransferStatusCode.HoldBurned, "A transfer can only be executed from status HoldBurned");
        ePesos.mint(orderedTransfer.target, orderedTransfer.value.sub(orderedTransfer.fee));
        eDollars.mint(orderedTransfer.operator,orderedTransfer.fee);
        emit TransferExecuted(msg.sender, operationId);
    }

    function _setFeeTasa(string memory operationId, uint256 fee, uint256 tasa) internal returns(bool){
        Transfer storage orderedTransfer = orderedTransfers[operationId.toHash()];
        require(orderedTransfer.value != 0, "This operationId doesn't exist");
        require(fee > 0, "Fee must be greater than zero");
        require(tasa > 0, "Fee must be greater than zero");
        orderedTransfer.fee = fee;
        orderedTransfer.tasa = tasa;
        orderedTransfer.status = TransferStatusCode.FeeSet;

    }

    function _checkTransfer(address to) private pure {
        require(to != address(0), "Payee address must not be zero address");
    }

}
